pragma solidity ^0.5.0;

contract Contract {
    mapping (bytes32 => uint256) public storageMap;
    mapping (address => uint256) public balanceOf;
    address public owner;
    bool public status;
    uint256 public totalSupply;

    constructor(uint256 initialSupply) public {
        owner = msg.sender;
        totalSupply = initialSupply;
        balanceOf[msg.sender] = initialSupply;
        status = true;
    }

    function transfer(address _to, uint256 _value) public {
        require(status == true);
        require(balanceOf[msg.sender] >= _value);
        require(balanceOf[_to] + _value >= balanceOf[_to]);

        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
    }

    function setStorage(bytes32 _key, uint256 _value) public {
        require(msg.sender == owner);
        storageMap[_key] = _value;
    }

    function getStorage(bytes32 _key) public view returns (uint256) {
        return storageMap[_key];
    }

    function disableContract() public {
        require(msg.sender == owner);
        status = false;
    }

    function enableContract() public {
        require(msg.sender == owner);
        status = true;
    }

    function() external payable {
        revert();
    }
}
